import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <Container fluid>
                    <Row>
                        <Row md={2} lg={2} className='cabecera'>
                            Hola
                        </Row>
                    </Row>
                    <Row md={10} lg={10} className='cabecera'>Fabriicio</Row>
                </Container>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                    justify-content: center;
                    align-items: center;
                }

                .cabecera{
                    width: 100%;
                    border: 1px solid;
                }                

            `}</style>
        </Layout>
    );
}

export default dashboard;
